import React, {useState, useEffect} from 'react'
import useShared from './useShared';


const Fraction1 = ({difficulty2}) => {

  
  const { 
          randomFrac,
          setRandomFrac,
          inputRange,
          multiplyNumber,
          clearInputs,
          getRandomNumber,
          handleNext,
          } = useShared();
  
  // const [inputs, setInputs] = useState({
  //   numerator: 0,
  //   denominator: 0
  // })

  // const [randomFrac, setRandomFrac] = useState({
  //   numerator : 1,
  //   denominator : 1
  // })
  
  // const [inputRange, setInputRange] = useState({
  //   min:1,
  //   max:9
  // })

  // function getRandomNumber(min, max) {
  //   let randomNumber;
  //   do {
  //     randomNumber = Math.floor(Math.random() * (max - min + 1)) + min;
  //   } 
  //   while (randomNumber===0)
    
  //   return randomNumber;
  // }


  

  useEffect(() => {
    handleNext(difficulty2)
  }, [difficulty2]);
  

  return (
    <div className='flex flex-col'>
      <button onClick={()=>console.log(difficulty2,inputRange, randomFrac, typeof(difficulty2))}>show me</button>
        <div className='math  flex justify-start  mt-2'>
              <div>
                  <div>
                     <table className='digit'>
                        <tr>
                          <td className='flex flex-row items-center'>
                             <table className='first col'>
                              <tbody className=''>
                                  <tr className=''>{randomFrac.numerator}</tr>
                                   
                                  <tr className='line-tr'>
                                    <div className='line'></div>
                                  </tr>

                                  <tr>{randomFrac.denominator}</tr>      
                               </tbody>
                             </table>

                              <table className='opertor mx-3 md:mx-6'>
                                <tbody>
                                    <tr>
                                      <h2>&times;</h2>
                                    </tr>
                                </tbody>
                              </table>

                              <table className='third col'>
                              <tbody className=''>
                                  <tr className=''>
                                     <input  className='input digit-input '/>
                                  </tr>
                                   
                                  <tr className='line-tr'>
                                    <div className='line-input'></div>
                                  </tr>

                                  <tr>
                                     <input  className='input digit-input '/>
                                  </tr>      
                               </tbody>
                             </table>

                             <table className='opertor mx-3 md:mx-6'>
                                <tbody>
                                    <tr>
                                      <h2>=</h2>
                                    </tr>
                                </tbody>
                              </table>

                              <table className='fourth col'>
                              <tbody className=''>
                                  <tr className=''>{randomFrac.numerator*2}</tr>
                                   
                                  <tr className='line-tr'>
                                    <div className='line'></div>
                                  </tr>

                                  <tr>{randomFrac.denominator*2}</tr>      
                               </tbody>
                             </table>
                            
                          </td>
                        </tr>
                      </table>                 
                                       
                                            
                  </div>
                                
                  

                  <div className='buttons w-full  flex flex-row justify-start mt-14'>
                    <button  className='btn-drill'>Check</button>

                    <button onClick={()=>handleNext()}  className='btn-drill ml-1 md:ml-3'>Next</button>
                  </div>
              </div>   
        </div>      
    </div>
  )
}

export default Fraction1
